import React from 'react';
import '../styles/containerdashdoard.css';

function ContainerDashBoard() {
    return (
        <div className="dashboard-page">
            <div className="main-content">
                <Header />
                <DashboardContent />
            </div>
        </div>
    );
}


function Header() {
    return (
        <div className="header">
            <input
                type="text"
                className="search-bar"
                placeholder="Search resources..."
            />
            <div className="header-icons">
                <button className="create-button">Create Resource</button>
            </div>
        </div>
    );
}

function HeaderIcon({ icon }) {
    return <div className="header-icon">{icon}</div>;
}

function DashboardContent() {
    return (
        <div className="dashboard">
            <div className="dashboard-header">
                <h2>Container Dashboard</h2>
                <div className="dropdown-icon">⬇️</div>
            </div>
            <div className="dashboard-content">
                <SummaryCard title="Container Location Summary" />
                <SummaryCard title="Container Type Summary" />
                <RightSidebar />
            </div>
        </div>
    );
}

function SummaryCard({ title }) {
    return (
        <div className="summary-card">
            <h3>{title}</h3>
            <p>Some summary data here...</p>
            <div className="view-all">View All</div>
        </div>
    );
}

function RightSidebar() {
    return (
        <div className="right-sidebar">
            <SmallCard title="Total Containers With Alerts" count="19" />
            <SmallCard title="Team Management" count="25" />
            <AdCard />
        </div>
    );
}

function SmallCard({ title, count }) {
    return (
        <div className="small-card">
            <h4>{title}</h4>
            <div className="card-content">
                <div className="card-count">{count}</div>
                <div className="view-all">View All</div>
            </div>
        </div>
    );
}

function AdCard() {
    return (
        <div className="ad-card">
            <h4>Containers Mapping</h4>
            <div className="learn-more">Learn More</div>
        </div>
    );
}

function Icon() {
    return <span>🚢</span>;
}

export default ContainerDashBoard;
